    eq(peg[c('foo')]('fop'), false);
    eq(peg[c('foo')]('fOo'), false);
    eq(peg[c('foo')]('Foo'), false);

    eq(!! peg[c(['foo', 'bar'])], true);        // Check for errors initializing the parser

    eq(peg[c(['foo', 'bar'])]('foo'), 'foo');
    eq(peg[c(['foo', 'bar'])]('bar'), 'bar');
